sensitive_patterns = [r'[\w\.-]+@[\w\.-]+', r'\b\d{3}[-.]?\d{2}[-.]?\d{4}\b']
def mask_sensitive(text):
    def masker(match):
        return '*' * len(match.group(0))
    masked = text
    for pattern in sensitive_patterns:
        masked = re.sub(pattern, masker, masked)
    return masked
masked_text = mask_sensitive(text)
